import React, { useEffect, useState } from "react";
import { Card } from "./Card";
import DogService from "../../services/Dog.service";

export const Cards = () => {

  const [dogs, setDogs] = useState([]);

  useEffect(() => {
    DogService.getMascotas()
       .then((data) => setDogs(data.results))
       .catch((error) => console.log(error));

  }, [dogs])

  const cardsList = dogs.map((m) => <Card dog={m} key={m.id}/>)

  return (
    <div classNameame="character">
    <div classNameame="album py-5 bg-body-tertiary">
      <div classNameame="container">
        <div classNameame="row row-cols-1 row-cols-sm-2 row-cols-md-3 g-3">
          {cardsList}
        </div>
      </div>
    </div>
    </div>
  );
};
